MATCH (pa:Patient)-[:HAS_ALLERGY]->(a:Allergy) 
WHERE a.description = 'House dust mite (organism)' 
RETURN DISTINCT a.category;

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.description = 'Tree pollen (substance)'
RETURN a.reactioncode;

MATCH (payer:Payer {name: 'Dual Eligible'}), (med:Medication)
WHERE NOT (payer)-[:HAS_COVERED]->(med)
RETURN COUNT(med.code) AS uncovered_medications;

MATCH (p:Payer {name: 'Dual Eligible'})-[:HAS_COVERED]->(e:Encounter)-[:HAS_ORDERED]->(pro:Procedure) 
            WHERE NOT (p)-[:HAS_COVERED]->(pro) 
            RETURN COUNT(DISTINCT pro.id);

MATCH (p:Patient)-[:HAS_CAREPLAN]->(c:CarePlan)-[:HAS_ORDERED]->(e:Encounter)
WHERE c.description = 'Infectious disease care plan (record artifact)'
RETURN e.id;

MATCH (o:Observation)
WHERE o.description = 'Pain severity - 0-10 verbal numeric rating [Score] - Reported'
RETURN o.type AS observationType;

MATCH (p:Patient)-[:HAS_DIAGNOSED]->(a:Allergy) 
WHERE a.description = 'Latex (substance)' 
RETURN count(DISTINCT p);

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.description = 'House dust mite (organism)'
RETURN a.start;

MATCH (p:Patient)-[:HAS_PRESCRIBED]->(m:Medication) 
            WHERE m.code="197604" 
            RETURN DISTINCT p.firstName, p.lastName;

MATCH (o:Observation)
WHERE o.description = 'Within the last year  have you been afraid of your partner or ex-partner?' AND o.date >= DATE('now', '-1 year')
RETURN o.type;

MATCH (m:Medication)-[:IS_PRESCRIBED_FOR]->(p:Patient)-[:HAS_CLAIM]->(c:Claim)
WHERE m.description = "Simvastatin 10 MG Oral Tablet" 
RETURN COUNT(DISTINCT p.id) / COUNT(DISTINCT c.id) * 100 AS successRate;

MATCH (c:Condition)-[:IS_ABOUT]->(p:Patient), (e:Encounter)-[:HAS_DIAGNOSED]->(c)
WHERE c.code = 'K94.2' AND e.isEnd=TRUE
RETURN p.firstName, p.lastName;
